['#include<stdio.h>
#include<stdlib.h>
int main()
{
	int n,arr[1000000];
	scanf("%d",&n);
	float max=-1,min=1000000008;
	int i;
	for(i=0;i<n;i++)
	{
		scanf("%d",arr+i);
		if(arr[i] > max) max=arr[i];
		if(arr[i] < min) min=arr[i];
	}
	float mid=(max+min)/2.0;
	for(i=0;i<n;i++){
		if(arr[i]==max || arr[i]==min || arr[i]==mid) continue;
		else break;
	}
	if(i==n) printf("YES");
	else printf("NO");
	return 0;
}
