int main()
{
    long long int L1, R1, L2, R2, k;
    long long int left, right;
    scanf("%I64d%I64d%I64d%I64d%I64d", &L1, &R1, &L2, &R2, &k);
    if(L1 < L2)
        left = L2;
    else
        left = L1;
    if(R1 < R2)
        right = R1;
    else
        right = R2;
    if(left > right)
    {
        puts("0");
        return 0;
    }
    if(k >= left && k <= right)
        printf("%I64d\n", right-left);
    else
        printf("%I64d\n", right-left+1);
}']

