['#include<stdio.h>
#include<string.h>
#include<stdlib.h>
#include<math.h>
#define Max(a,b) a>b ? a : b
#define Min(a,b) a<b ? a : b
int main()
{
    int a, b, c, d, e, k;
    scanf("%d %d %d %d %d", &a, &b, &c, &d, &e);
    a = Max(a,c);
    b = Min(b,d);
    k = b-a+1;
    if(e >= a && e <= b)
        k--;
    printf("%d\n", k);
    return 0;
}

