['#include <stdio.h>
#include <stdlib.h>

int partitionner(int *tab, int indexPivot, int indexLastElement){

  int pivot = tab[indexPivot], i = indexPivot-1, j = indexLastElement+1, tmp = 0;

  while(1){
    do{
      i++;
    }while(tab[i] < pivot);
    do{
      j--;
    }while(tab[j] > pivot);
    if(i<j){
      tmp = tab[i];
      tab[i] = tab[j];
      tab[j] = tmp;
    }
    else{
      return j;
    }
  }
}

void triRapide(int *tab, int indexPivot, int indexLastElement ){
  int newPivot = 0;
  if(indexPivot < indexLastElement){
    newPivot = partitionner(tab, indexPivot, indexLastElement);
    triRapide(tab, newPivot+1, indexLastElement);
    triRapide(tab, indexPivot, newPivot);
  }
}

int main (void){
  int i = 0, j = 0, n = 0 , x = 0, y = 0, counter = 0;
  scanf("%d",&n);
  int t[n];

  for ( i = 0; i < n; i++) {
    scanf("%d", &t[i]);
  }

  if(n > 1)
    triRapide(t, 0, n-1);

  x = t[0];
  counter++;
  for ( i = 1 ; i < n; i++) {
    y=t[i];
    if(y > x){
      x = y;
      counter++;
      if(counter > 3){
        printf("NO");
        return 1;
      }
    }
  }

  if(counter == 1 ){
    printf("YES");
    return 0;
  }

  int mesValeurs[counter];

  mesValeurs[0] = t[0];
  j = 0;
  for ( i = 1 ; i < n; i++) {
    y=t[i];
    if(y > mesValeurs[j]){
      mesValeurs[++j] = y;
      }
    }

  if(counter == 2){
    if(mesValeurs[1]==2*mesValeurs[0]){
      printf("YES");
      return 0;
    }
    else{
      printf("NO");
      return 1;
    }
  }


  if( mesValeurs[0] + mesValeurs[1] == mesValeurs[2] ){
    printf("YES");
    return 0;
  }
  else{
    printf("NO");
    return 1;
  }

  return 0;
}
