['#include <stdio.h>
#include <stdlib.h>

#define N 100000
#define INF 0x3f3f3f3f

int compare(const void *a, const void *b) {
	int ia = *(int *) a;
	int ib = *(int *) b;

	return ia - ib;
}

int main() {
	static int aa[N];
	static char used[N + 1];
	int n, i, k, max, min;

	scanf("%d", &n);
	k = max = 0;
	min = INF;
	for (i = 0; i < n; i++) {
		scanf("%d", &aa[i]);
		if (!used[aa[i]]) {
			k++;
			used[aa[i]] = 1;
		}
		if (max < aa[i])
			max = aa[i];
		if (min > aa[i])
			min = aa[i];
	}
	qsort(aa, n, sizeof *aa, compare);
	if (k < 3)
		printf("YES\n");
	else if (k > 3)
		printf("NO\n");
	else
		printf(max - aa[n / 2] == aa[n / 2] - min ? "YES\n" : "NO\n");
	return 0;
}
